import React from 'react';
import './PlayArea.sass'

function PlayArea(props) {

    console.log(props.gameData)

    function renderCells() {
        let cells = []
        console.log(props.gameData)
        for (let i = 0; i < props.gameData; i++) {
            console.log()
            cells.push(
                <div className='PlayArea__cell'>{props.gameData[i]}</div>
            )
        }
    }

    return(
        <main className="PlayArea">
            {renderCells}
        </main>
        )
}

export default PlayArea;
